pragma solidity >=0.4.21 <0.6.0;

interface VotingContract {
    function registerInternalProposal (
        uint id,
        string calldata title,
        uint ProposalType,
        uint startDate,
        uint endDate,
        string calldata url,
        bytes32 hashCode
    ) external returns (uint);

    function addAnchor(string calldata _name, string calldata _url, address[] calldata _members) external;
    function getProposalStatus(uint id) external view returns ( uint, uint, uint, address, bool, bool, uint, uint);
}

contract AnchorVoting {

    enum ProposalTypes { AddAnchor, RemoveAnchor, ChangeAnchorMember, RenewAccessToken, ChangeConfig }

    struct AddAnchorProposal {
        string name;
        string url;
        address[] members;
        uint executionTime;
    }

    mapping ( uint => AddAnchorProposal ) public addAnchorProposals;

    uint proposalCounts = 0;

    uint public addAnchorThreshold = 51;

    uint public removeAnchorThreshold = 80;

    VotingContract mainContract;

    constructor(address _address) public {
        mainContract = VotingContract(_address);
    }

    function registerAddAnchorProposal(
      string memory _anchorName,
      string memory _anchorUrl,
      address[] memory _members,
      uint _startDate,
      uint _endDate,
      string memory _url,
      bytes32 _hashCode
      ) public {
          require(bytes(_anchorName).length > 0, "select name for anchor");
          proposalCounts++;
          uint id = mainContract.registerInternalProposal(
              proposalCounts,
              "add anchor",
              uint(ProposalTypes.AddAnchor),
              _startDate,
              _endDate,
              _url,
              _hashCode);
          addAnchorProposals[id] = AddAnchorProposal(_anchorName, _anchorUrl, _members, 0);
    }

    function runAddAnchorProposal(uint _id) internal {
        AddAnchorProposal memory proposal = addAnchorProposals[_id];
        require(bytes(proposal.name).length > 0, "propsal not found");
        require(proposal.executionTime == 0, "the proposal executed before");
        uint upPercentage = checkProposalUpPercentage(_id);
        if( upPercentage >= addAnchorThreshold ) {
            mainContract.addAnchor(proposal.name, proposal.url, proposal.members);
        }
        addAnchorProposals[_id].executionTime = now;
    }

    function checkProposalUpPercentage(uint _id) internal view returns(uint) {
        (,,, address contractAddress,, bool isFinished, uint upPercentage,) = mainContract.getProposalStatus(_id);
        require(contractAddress == address(this), "the propsal is not an internal proposal");
        require(isFinished,"the propsal is not finished");
        return upPercentage;
    }


}
